import React, { Component } from 'react';
import bemdito_producs from '../dados/bemdito_producs';

class Products extends Component {
  render() {
    return (
      <>
        <h1>Aqui vou colocar os produtos</h1>
        <div className="content">
        { bemdito_producs.map((item) =>(
          <div key={item.id} className="card">
            <h4>{`Pruduto ${item.produto} - Preço R$ ${item.preco}`}</h4>
          </div> 
        ))}
      </div>
      </>
    )
  }
}

export default Products;
